The dartboard below has a radius of 6 inches. Each of the concentric circles has a radius two inches less than the next larger circle. If nine darts land randomly on the target, how many darts would we expect to land in a non-shaded region?

[asy]import graph;
fill(Circle((0,0),15),gray(0.7));
fill(Circle((0,0),10),white);
draw(Circle((0,0),20));
draw(Circle((0,0),15));
draw(Circle((0,0),10));
[/asy]

How many paths are there from $A$ to $B$ on the lines of the grid shown, if every step must be up or to the right?[asy]size(3cm,3cm);int w=6;int h=3;int i;for (i=0; i<h; ++i){ draw((0,i) -- (w-1,i));}for (i=0; i<w; ++i){ draw((i, 0)--(i,h-1));}label("$B$", (w-1,h-1), NE);label("$A$", (0,0), SW);[/asy]
For example, here is one such valid path highlighted in blue:
[asy]
size(3cm,3cm);
int w=6;
int h=3;
int i;
for (i=0; i<h; ++i){ 
draw((0,i) -- (w-1,i));
}for (i=0; i<w; ++i){ 
draw((i, 0)--(i,h-1));
}
label("$B$", (w-1,h-1), NE);
label("$A$", (0,0), SW);

draw((0,0)--(1,0), blue+1.5);
draw((1,0)--(1,1), blue+1.5);
draw((1,1)--(2,1), blue+1.5);
draw((2,1)--(3,1), blue+1.5);
draw((3,1)--(4,1), blue+1.5);
draw((4,1)--(4,2), blue+1.5);
draw((4,2)--(5,2), blue+1.5);
[/asy]

There is a total of 70 squares of three sizes whose vertices are points on this rectangular $3\times n$ grid of points. What is the value of $n$?

[asy]

unitsize(0.4 inch);

dot((0,0),linewidth(9bp));
dot((1,0),linewidth(9bp));
dot((2,0),linewidth(9bp));
dot((0,1),linewidth(9bp));
dot((0,2),linewidth(9bp));
dot((1,1),linewidth(9bp));
dot((2,1),linewidth(9bp));
dot((1,2),linewidth(9bp));
dot((2,2),linewidth(9bp));

filldraw((2.95,-0.05)--(3.05,-0.05)--(3.05,0.05)--(2.95,0.05)--cycle,black);
filldraw((2.45,-0.05)--(2.55,-0.05)--(2.55,0.05)--(2.45,0.05)--cycle,black);
filldraw((3.45,-0.05)--(3.55,-0.05)--(3.55,0.05)--(3.45,0.05)--cycle,black);

filldraw((2.95,0.95)--(3.05,0.95)--(3.05,1.05)--(2.95,1.05)--cycle,black);
filldraw((2.45,0.95)--(2.55,0.95)--(2.55,1.05)--(2.45,1.05)--cycle,black);
filldraw((3.45,0.95)--(3.55,0.95)--(3.55,1.05)--(3.45,1.05)--cycle,black);

filldraw((2.95,1.95)--(3.05,1.95)--(3.05,2.05)--(2.95,2.05)--cycle,black);
filldraw((2.45,1.95)--(2.55,1.95)--(2.55,2.05)--(2.45,2.05)--cycle,black);
filldraw((3.45,1.95)--(3.55,1.95)--(3.55,2.05)--(3.45,2.05)--cycle,black);

dot((4,0),linewidth(9bp));
dot((5,0),linewidth(9bp));
dot((4,1),linewidth(9bp));
dot((5,1),linewidth(9bp));
dot((4,2),linewidth(9bp));
dot((5,2),linewidth(9bp));

[/asy]

A set of three points is chosen randomly from the grid shown. Each three-point set has the same probability of being chosen. What is the probability that the points lie on the same straight line?

[asy]
size(50);
for (int i=0; i<3; ++i) {
for (int j=0; j<3; ++j) {
dot((i,j));};}
[/asy]

Each square of the three by three grid is painted so that the whole picture has at least the two lines of symmetry indicated. Each grid square is painted one solid color. What is the maximum number of colors that could have been used? [asy]size(100);
draw((0,0)--(0,3)--(3,3)--(3,0)--cycle);
draw((1,0)--(1,3));
draw((2,0)--(2,3));
draw((0,1)--(3,1));
draw((0,2)--(3,2));
draw((-0.2,-0.2)--(3.2,3.2),dashed);
dot((0,0));dot((3,3)); dot((1.5,0)); dot((1.5,3));
draw((1.5,-0.3)--(1.5,3.3), dashed);
[/asy]

How many different rectangles are in the figure? [asy]
defaultpen(linewidth(0.8));
draw((0,0)--(0,5)--(8,5)--(8,0)--cycle);
draw((0,3)--(8,3));
draw((6,5)--(6,0));
[/asy]

How many rectangles are in the array below?

[asy]
for(int i = 0; i<3; ++i)
{

for(int j = 0; j<3; ++j)

{

draw((3i,j)--(3i+3,j)--(3i+3,j+1)--(3i,j+1)--(3i,j)--cycle,linewidth(2));

}
}
[/asy]

Regions $A, B, C, J$ and $K$ represent ponds. Logs leave pond $A$ and float down flumes (represented by arrows) to eventually end up in pond $B$ or pond $C$. On leaving a pond, the logs are equally likely to use any available exit flume. Logs can only float in the direction the arrow is pointing. What is the probability that a log in pond $A$ will end up in pond $B$? Express your answer as a common fraction.

[asy]
label("$A$",(10,22),S);
label("$B$",(10,2),S);
label("$C$",(10,-7),S);
label("$J$",(2,13),S);
label("$K$",(10,12),S);
path a=(10,-10)..(20,0)--(0,0)..cycle;
path b=(10,-7)..(3,0)--(17,0)..cycle;
draw(a);
draw(b);
fill((3.1,0.1)--(16.9,0.1)--(16.9,-0.1)--(3.1,-0.1)--cycle,white);
draw(Circle((10,0),3));
draw(Circle((10,10),3));
draw(Circle((10,20),3));
draw((10,16.9)--(10,13.1),Arrow);
draw((10,6.9)--(10,3.1),Arrow);
draw(Circle((2,10),3));
draw((2,7)--(2.5,0),Arrow);
draw((1.5,7)--(0.2,0),Arrow);
draw((10,16.9)--(2,13.2),Arrow);
draw((10,16.9)--(19.8,0),Arrow);
draw((10,6.9)--(17.2,0),Arrow);
draw((3,8)--(10,3.1),Arrow);
[/asy]

A diagonal of a polyhedron is a line segment connecting two non-adjacent vertices. How many diagonals does a pentagonal prism have? [asy]
import three;
size(100);
defaultpen(linewidth(0.7));
currentprojection = orthographic(-0.2,-1,2/3);

void drawPentagon (real h)
{

path3 y;

y=(0,0,h)--(3,0,h)--(5,3,h)--(3,6,h)--(0,5,h)--cycle;

draw(surface(y),white,nolight);

draw(y);
}

void drawRectangle(triple a, triple b, real h)
{

path3 y;

y=a--b--b+(0,0,h)--a+(0,0,h)--cycle;

draw(surface(y),white,black,nolight);
}

drawRectangle((0,0,0),(0,5,0),4);
drawRectangle((0,0,0),(3,0,0),4);
drawRectangle((3,0,0),(5,3,0),4);
drawPentagon(4);

