[/asy]

Two circles with spinners at their centers are divided into three equal regions as shown. When both spinners are spun, what is the probability that the product of the two values is negative? Express your answer as a common fraction. [asy]
size(140);
void spinner(picture pic=currentpicture, real rotate, int a, int b, int c)
{
dot(pic,(0,0),linewidth(4));
draw(pic, unitcircle ^^ (0,0)--dir(90+rotate) ^^ (0,0)--dir(210+rotate) ^^ (0,0)--dir(-30+rotate));
label(pic, "$"+string(a)+"$",dir(30+rotate)/2,fontsize(10pt));
label(pic, "$"+string(b)+"$",dir(150+rotate)/2,fontsize(10pt));
label(pic, "$"+string(c)+"$",dir(-90+rotate)/2,fontsize(10pt));
}
picture p;
spinner(0,-1,-3,5); spinner(p,180,2,4,-6);
draw((0,0)--dir(-10)/2,EndArrow(4)); draw(p,(0,0)--dir(-75)/2,EndArrow(4)); add(shift(2.5*right)*p);[/asy]

A European train compartment has six seats.  Four of the seats are broken.  Wilhelm needs to fill out a form like the one here to indicate that there are broken seats.  If he randomly checks off four of the seats in the diagram, what is the probability that he marked the correct seats?  Express your answer as a common fraction.

[asy]

draw((0,0)--(24,0)--(24,18)--(0,18)--(0,0));

label("$\textbf{Maintenance Report}$",(12,16));

draw((2,2)--(22,2)--(22,14)--(2,14)--(2,2));

draw((4,4)--(8,4)--(8,6)--(4,6)--(4,4));

draw((10,4)--(14,4)--(14,6)--(10,6)--(10,4));
label("$\surd$",(12,5));

draw((16,4)--(20,4)--(20,6)--(16,6)--(16,4));
label("$\surd$",(18,5));

draw((4,10)--(8,10)--(8,12)--(4,12)--(4,10));
label("$\surd$",(6,11));

draw((10,10)--(14,10)--(14,12)--(10,12)--(10,10));
label("$\surd$",(12,11));

draw((16,10)--(20,10)--(20,12)--(16,12)--(16,10));

[/asy]

Link is coloring a triforce, which consists of four equilateral triangles and is depicted below. He has three colors to use: gold, black, and green. So that it remains recognizable, he doesn't want to color any two triangles the same color if they share a side. How many different ways can he color the triforce? (Two colorings that differ by rotation are considered distinct.) [asy]
size(50);
draw((0,0)--(2,0)--(1,1.732)--cycle);
draw((1,0)--(1.5,.866)--(.5,.866)--cycle);
[/asy]

On the game board below Kendra will start at the center of the board. For each turn she will spin this spinner with four congruent sectors once, and then she will move one space in the direction indicated on the spinner. The "Start'' square does not have a numerical value, but Kendra may land on it during her turns. What is the probability that the sum of the numbers in the spaces on which she will land will be exactly 30 after her third complete turn? Express your answer as a common fraction.

[asy]size(80);
import graph;
draw(Circle((0,0),1),linewidth(1));
draw((-1,0)--(1,0),linewidth(1)); draw((0,-1)--(0,1),linewidth(1));
label("Move",(sqrt(2)/4,sqrt(2)/4+.15),fontsize(10pt));
label("Left",(sqrt(2)/4,sqrt(2)/4-.15),fontsize(10pt));
label("Move",(-sqrt(2)/4,sqrt(2)/4+.15),fontsize(10pt));
label("Right",(-sqrt(2)/4,sqrt(2)/4-.15),fontsize(10pt));
label("Move",(-sqrt(2)/4,-(sqrt(2)/4-.15)),fontsize(10pt));
label("Down",(-sqrt(2)/4,-(sqrt(2)/4+.15)),fontsize(10pt));
label("Move",(sqrt(2)/4,-(sqrt(2)/4-.15)),fontsize(10pt));
label("Up",(sqrt(2)/4,-(sqrt(2)/4+.15)),fontsize(10pt));
dot((0,0),linewidth(5)); draw((0,0)--1/2 dir(-70),linewidth(1.5),EndArrow(5));[/asy]

[asy]size(200);
picture box10,box15,box5,box20;
filldraw(box5,(-1,-.5)--(-1,.5)--(1,.5)--(1,-.5)--cycle,white,linewidth(1)); label(box5,"5",(0,0));
filldraw(box10,(-1,-.5)--(-1,.5)--(1,.5)--(1,-.5)--cycle,gray(.6),linewidth(1)); label(box10,"10",(0,0));
filldraw(box15,(-1,-.5)--(-1,.5)--(1,.5)--(1,-.5)--cycle,white,linewidth(1)); label(box15,"15",(0,0));
filldraw(box20,(-1,-.5)--(-1,.5)--(1,.5)--(1,-.5)--cycle,gray(.6),linewidth(1)); label(box20,"20",(0,0));
void b10(real x, real y)
{
add(shift(x*right)*shift(y*up)*box10);
}
void b15(real x, real y)
{
add(shift(x*right)*shift(y*up)*box15);
}
void b5(real x, real y)
{
add(shift(x*right)*shift(y*up)*box5);
}
void b20(real x, real y)
{
add(shift(x*right)*shift(y*up)*box20);
}
for(int i = 0; i<3; ++i)
{
draw((8.5-2.5i,1.5i+2)--(-8.5+2.5i,1.5i+2),linewidth(1));
draw((8.5-2.5i,-1.5i-2)--(-8.5+2.5i,-1.5i-2),linewidth(1));
}
for(int i = 0; i<3; ++i)
{
draw((8.5-2.5i,2+1.5i)--(8.5-2.5i,-2-1.5i),linewidth(1));
draw((-8.5+2.5i,2+1.5i)--(-8.5+2.5i,-2-1.5i),linewidth(1));
}
draw((8.5,0)--(-8.5,0),linewidth(1));
draw((0,5)--(0,-5),linewidth(1));
filldraw((-1,1)--(1,1)--(1,-1)--(-1,-1)--cycle,white,linewidth(1)); label("Start",(0,0),fontsize(8pt));
b10(0,2); b10(-3.5,2); b10(3.5,2); b10(-3.5,0); b10(3.5,0); b10(0,-2); b10(-3.5,-2); b10(3.5,-2); b10(3.5,5); b10(-3.5,5); b10(3.5,-5); b10(-3.5,-5);
b5(6,0); b5(8.5,0); b5(0,3.5); b5(0,5); b5(0,-3.5); b5(0,-5); b5(3.5,-3.5); b5(3.5,3.5);b5(-3.5,-3.5);b5(-3.5,3.5); b5(-6,0); b5(-8.5,0);

b20(6,3.5); b20(6,-3.5); b20(-6,3.5); b20(-6,-3.5); b20(8.5,2); b20(-8.5,2); b20(8.5,-2); b20(-8.5,-2);

b15(6,2); b15(6,-2); b15(-6,2); b15(-6,-2);[/asy]

Congruent segments are used to form equilateral triangles in this sequence so that each figure contains one more triangle than the preceding figure. Figure 3 of the sequence is made with seven congruent segments. How many congruent segments must be used to make Figure 25 of the sequence?

[asy]
draw((0,0)--(10,0)--(5,8.7)--cycle);
draw((15,0)--(25,0)--(30,8.7)--(20,8.7)--cycle);
draw((20,8.7)--(25,0));
draw((35,0)--(55,0)--(50,8.7)--(40,8.7)--cycle);
draw((40,8.7)--(45,0)--(50,8.7));
draw((60,0)--(80,0)--(85,8.7)--(65,8.7)--cycle);
draw((65,8.7)--(70,0)--(75,8.7)--(80,0));
label("Figure 1",(2,0),S);
label("Figure 2",(20,-10),S);
label("Figure 3",(45,0),S);
label("Figure 4",(76,-10),S);
[/asy]

There are nine unit triangles in the three rows of this triangle. If you add three more rows to the bottom of this triangle so that each row has 2 more unit triangles than the previous row, how many unit triangles will there be?

[asy]
draw((0,0)--(15,26)--(30,0)--cycle);
draw((5,8.7)--(10,0)--(20,17.3));
draw((20,0)--(25,8.7)--(5,8.7));
draw((20,0)--(10,17.3)--(20,17.3));
[/asy]

The wheel shown is spun twice, so that the numbers indicated by the pointer are randomly determined (with each number on the wheel being equally likely). The two numbers determined in this way are recorded. The first number is divided by 4, determining one of the remainders 1,2,3 marking the columns of the checkerboard shown. The second number is divided by 5, determining one of the remainders 1,2,3,4 marking the rows of the checkerboard. Finally, a checker is placed on the square where this column and row meet. What is the probability that the checker is placed on a shaded square of the checkerboard?

[asy]
unitsize(1cm);
draw(Circle((0,0),2),linewidth(0.7));
draw((1.7,1)--(-1.7,-1),linewidth(0.7));
draw((1.7,-1)--(-1.7,1),linewidth(0.7));
draw((0,2)--(0,-2));
label("1",(0.8,0.5),NW);
label("2",(0.8,-0.5),SW);
label("6",(-0.8,0.5),NE);
label("9",(-0.8,-0.5),SE);
label("3",(-0.7,0),W);
label("7",(0.7,0),E);
draw((-2.8,0)--(-2.1,0),Arrow);
label("Pointer",(-2.8,0),W);
fill((3,0)--(3,1)--(4,1)--(4,0)--cycle,gray(0.7));
fill((3,-2)--(3,-1)--(4,-1)--(4,-2)--cycle,gray(0.7));
fill((4,1)--(4,2)--(5,2)--(5,1)--cycle,gray(0.7));
fill((4,-1)--(4,0)--(5,0)--(5,-1)--cycle,gray(0.7));
fill((5,0)--(5,1)--(6,1)--(6,0)--cycle,gray(0.7));
fill((5,-2)--(5,-1)--(6,-1)--(6,-2)--cycle,gray(0.7));
draw((3,-2)--(3,2)--(6,2)--(6,-2)--cycle,linewidth(0.7));
draw((3,-1)--(6,-1),linewidth(0.7));
draw((3,0)--(6,0),linewidth(0.7));
draw((3,1)--(6,1),linewidth(0.7));
draw((4,-2)--(4,2),linewidth(0.7));
draw((5,-2)--(5,2),linewidth(0.7));
label("1",(3.5,-2),S);
label("2",(4.5,-2),S);
label("3",(5.5,-2),S);
label("1",(3,-1.5),W);
label("2",(3,-0.5),W);
label("3",(3,0.5),W);
label("4",(3,1.5),W);
[/asy]

Fourteen white cubes are put together to form the figure on the right.  The complete surface of the figure, including the bottom, is painted red.  The figure is then separated into individual cubes.  How many of the individual cubes have exactly four red faces?

[asy]
size(150);
pair a=(1,0),b=(0,1),c=(0.45,0.4);

void drawcube(pair loc){
     filldraw(loc+b--loc--loc+a--loc+a+c--loc+a+b+c--loc+b+c--cycle,white);
     draw(loc+b--loc+a+b--loc+a+b+c^^loc+a+b--loc+a);
}

pair location[]={origin,b,a,2a,3a,3a+b,-c,3a-c,-2c,-2c+b,-2c+a,-2c+2a,-2c+3a,-2c+3a+b};

for(int i; i<14;++i){
   drawcube(location[i]);
}


[/asy]

Set $R$ is a set of rectangles such that (1) only the grid points shown here are used as vertices, (2) all sides are vertical or horizontal and (3) no two rectangles in the set are congruent. If $R$ contains the maximum possible number of rectangles given these conditions, what fraction of the rectangles in set $R$ are squares? Express your answer as a common fraction. [asy]import graph;
size(50);
for(int i = 0; i<5; ++i)
for(int j = 0; j<5; ++j)
fill(Circle((i,j),.1));
[/asy]

How many different triangles can be formed using three vertices of a hexagon as vertices of a triangle? [asy]size(75);
draw(dir(0)--dir(30)--dir(110)--dir(175)--dir(250)--dir(300)--cycle);
[/asy]

In how many ways can seven beads of distinct colors be put on the hexagonal grid shown, if reflections and rotations of an arrangement are considered equivalent?

[asy]
size(50);
dot((0,0));
dot((1,0));
dot((-1,0));
dot((.5,sqrt(3)/2));
dot((.5,-sqrt(3)/2));
dot((-.5,sqrt(3)/2));
dot((-.5,-sqrt(3)/2));
[/asy]

