Several figures can be made by attaching two equilateral triangles to the regular pentagon $ABCDE$ in two of the five positions shown. How many non-congruent figures can be constructed in this way?

[asy]
pair A,B,C,D,I;
A=(10,0);
B=(0,0);
C=(-3.1,9.5);
D=(5,15.4);
I=(13.1,9.5);
draw(A--B--C--D--I--cycle,linewidth(0.7));
draw(A--B--(5,-8.7)--cycle,dashed);
draw(A--I--(19.8,2.1)--cycle,dashed);
draw(C--B--(-9.8,2.1)--cycle,dashed);
draw(I--D--(14.15,19.4)--cycle,dashed);
draw(D--C--(-4.15,19.4)--cycle,dashed);
label("$A$",A,SE);
label("$B$",B,SW);
label("$C$",C,W);
label("$E$",I,E);
label("$D$",D,N);
[/asy]

A target consists of four concentric circles with radii 4 inches, 6 inches, 8 inches and 10 inches as shown. Given that a dart is thrown that hits the target at a random point, what is the probability that it hits a shaded region? Express your answer as a common fraction.

[asy]size(100); import graph; fill(Circle((0,0),5),gray(.6));

clip(Circle((0,0),2) ^^ Circle((0,0),3) ^^ Circle((0,0),4),fillrule(1));
draw(Circle((0,0),2) ^^ Circle((0,0),3) ^^ Circle((0,0),4) ^^ Circle((0,0),5));[/asy]

Three different one-digit positive integers are placed in the bottom row of cells. Numbers in adjacent cells are added and the sum is placed in the cell above them. In the second row, continue the same process to obtain a number in the top cell. What is the difference between the largest and smallest numbers possible in the top cell? [asy]
path box=(0,0)--(1,0)--(1,1)--(0,1)--cycle;
draw(box);
draw(shift(1.5,0)*box);
draw(shift(3,0)*box);
draw(shift(.75,2)*box);
draw(shift(2.25,2)*box);
draw(shift(1.5,4)*box);
