Triangles $BDC$ and $ACD$ are coplanar and isosceles. If we have $m\angle ABC = 70^\circ$, what is $m\angle BAC$, in degrees?

[asy]
unitsize(2 cm);

defaultpen(linewidth(1pt)+fontsize(10pt));
pair a,b,c,d;
b = (0,0);
c = (1,0);
d = c+dir(140);
a = d+dir(70);
draw(a--b--c--cycle);
draw(d--c);
pair s,t;
s = (.5,0)+(0,.05);
t = (.5,0)+(0,-.05);
draw(s--t);
s = .5*(c+d) + .05*dir(50);
t = .5*(c+d) - .05*dir(50);
draw(s--t);
s = .5*(a+d) + .05*dir(160);
t = .5*(a+d) - .05*dir(160);
draw(s--t);
label("A",a,N);
label("B",b,SW);
label("C",c,SE);
label("D",d,NW);
label("$70^\circ$",b+(.05,.03),NE);
[/asy]

Let $ABCD$ be a rectangle.  Let $E$ and $F$ be points on $BC$ and $CD$, respectively, so that the areas of triangles $ABE$, $ADF$, and $CEF$ are 8, 5, and 9, respectively.  Find the area of rectangle $ABCD$.

[asy]
unitsize(1.5 cm);

pair A, B, C, D, E, F;

A = (0,2);
B = (0,0);
C = (3,0);
D = (3,2);
E = (3*B + 2*C)/5;
F = (2*D + C)/3;

draw(A--B--C--D--cycle);
draw(A--E--F--cycle);

label("$A$", A, NW);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NE);
label("$E$", E, S);
label("$F$", F, dir(0));
label("$8$", (A + B + E)/3);
label("$5$", (A + D + F)/3);
label("$9$", (C + E + F)/3);
[/asy]

