unitsize(0.15inch);
defaultpen(black);
draw(((0,0)--(8,0)--(8,6)--(0,6)--cycle));
draw(((1,1)--(7,1)--(7,5)--(1,5)--cycle));
fill(((1,1)--(7,1)--(7,5)--(1,5)--cycle),gray);
draw(((0,-.7)--(2.3,-.7)));
draw(((5.7,-.7)--(8,-.7)));
draw(((0,-.5)--(0,-.9)));
draw(((8,-.5)--(8,-.9)));
